import { defineMessages } from 'react-intl';

export const scope = 'app.components.CategoryDetailsForm';

export default defineMessages({
  categoryDetails: {
    id: `${scope}.categoryDetails`,
    defaultMessage: 'Category Details',
  },
  category: {
    id: `${scope}.category`,
    defaultMessage: 'Part Category',
  },
  categoryRequired: {
    id: `${scope}.categoryRequired`,
    defaultMessage: 'Category field is required.',
  },
  rootPartNumber: {
    id: `${scope}.rootPartNumber`,
    defaultMessage: 'Root Part Number',
  },
  rootPartNumberRequired: {
    id: `${scope}.rootPartNumberRequired`,
    defaultMessage: 'Root Part NUmber field is required.',
  },
  partNumber: {
    id: `${scope}.partNumber`,
    defaultMessage: 'Part Number',
  },
  partNumberRequired: {
    id: `${scope}.partNumberRequired`,
    defaultMessage: 'Part Number field is required.',
  },

  saveButtonLabel: {
    id: `${scope}.saveButtonLabel`,
    defaultMessage: 'Save & Next',
  },
  cancelButtonLabe: {
    id: `${scope}.cancelButtonLabe`,
    defaultMessage: 'Clear',
  },
  somethingWentWrong: {
    id: `${scope}.somethingWentWrong`,
    defaultMessage: 'Something went wrong while saving Category Details',
  },
  categoryDetailsSaveSuccess: {
    id: `${scope}.categoryDetailsSaveSuccess`,
    defaultMessage: 'Category Details was saved successfully.',
  },
  selectCategory: {
    id: `${scope}.selectCategory`,
    defaultMessage: 'Select Category',
  },
  partName: {
    id: `${scope}.partName`,
    defaultMessage: 'Part Name',
  },
  partNameRequired: {
    id: `${scope}.partNameRequired`,
    defaultMessage: 'Part Description field is required',
  },
  partUpdateSuccess: {
    id: `${scope}.partUpdateSuccess`,
    defaultMessage: 'Part details updated successfully',
  },
  allCategoriesNotPresent: {
    id: `${scope}.allCategoriesNotPresent`,
    defaultMessage: 'Error while fetching category',
  },
  mrp: {
    id: `${scope}.mrp`,
    defaultMessage: 'MRP',
  },
  mrpRequiredMessage: {
    id: `${scope}.mrpRequiredMessage`,
    defaultMessage: 'MRP is required',
  },
  sellingPrice: {
    id: `${scope}.sellingPrice`,
    defaultMessage: 'Selling Price',
  },
  hsn: {
    id: `${scope}.hsn`,
    defaultMessage: 'HSN Code',
  },
  hsnRequiredMessage: {
    id: `${scope}.hsnRequiredMessage`,
    defaultMessage: 'HSN is required',
  },
  taxSlab: {
    id: `${scope}.taxSlab`,
